import React from "react";
import {BrowserRouter as Router, Route, Switch} from "react-router-dom"
import Home from "./components/Home";
import Skills from "./components/Skills";
import "./App.css";
import "./components/Navbar";
import Navbar from "./components/Navbar";


const App = () => {
  return (
    <Router>
      <Navbar />

      <Switch>
        <Route path="/home" components={Home} exact>
          <Home/>
          </Route>
          <Route path="/about" components={About} exact>
          <About/>
          </Route>
          <Route path="/skills" components={Skills} exact>
          <Skills/>
          </Route>
          <Route path="/contact" components={Contact} exact>
          <Contact/>
          </Route>
          <Route path="/signup" components={Signup} exact>
          <Signup/>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
